INSERT INTO `forum` VALUES (1,1,0,1,NULL,NULL,1,'','Sziasztok ! Írjátok meg a véleményeiteket, észrevételeiteket a honlappal kapcsolatban.',NULL,NULL,1,4,'2005-05-30 17:32:39',NULL,'2005-07-24 18:19:51',NULL,NULL,1,'2006-02-13 15:35:17',4,1),(2,1,0,2,NULL,NULL,1,'','Üdv! Annyi javaslatom lenne e-bolthoz, hogy kellene egy jelzés miszerint éppen van-e raktáron az adott termékből vagy csak rendelhető. Igazán jó lenne. Tom:)',NULL,NULL,1,8,'2005-07-11 09:46:19',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4,2),(3,1,NULL,3,NULL,NULL,1,NULL,'Warbirds! A leltár után már csak azok a termékek lesznek fent a honlapon amik készleten vannak.A mostani lista még egyenlőre csak az adatbázis, ez tartalmaz olyan maketteket is amik jelenleg nincsenek készleten. Amikor eltűnik a piros felirat attól a perctől fogva ezek már nem lesznek fent. A honlap kb óránként fogja a bolti gépről ezt frissíteni. ',NULL,NULL,1,4,'2005-07-15 17:53:25',NULL,'2005-07-20 22:52:06',NULL,NULL,1,'2006-02-13 15:35:17',4,3),(4,3,NULL,4,NULL,NULL,1,NULL,'Na mennek a képek!!',NULL,NULL,1,23,'2005-07-20 13:47:16',NULL,'2005-07-24 18:20:04',NULL,NULL,1,'2006-02-13 15:35:17',4,4),(5,3,NULL,5,NULL,NULL,1,NULL,'Hol vannak a képek Főnök?',NULL,NULL,1,6,'2005-07-20 15:14:37',NULL,'2005-07-24 18:20:16',NULL,NULL,1,'2006-02-13 15:35:17',4,5),(6,3,NULL,6,NULL,NULL,1,NULL,'Dobd fel a galériába. Sajnos még csak egyesével tudod őket küldeni,de a héten már egy témához többet is lehet csatolni.',NULL,NULL,1,6,'2005-07-20 15:20:12',NULL,'2005-07-20 22:51:28',NULL,NULL,1,'2006-02-13 15:35:17',4,6),(7,3,NULL,7,NULL,NULL,1,NULL,'Főnők! Hol vannak a képek? Mikor küldöd?',NULL,NULL,1,6,'2005-07-21 16:13:10',NULL,'2005-07-24 18:19:39',NULL,NULL,1,'2006-02-13 15:35:17',4,7),(8,1,NULL,8,NULL,NULL,1,NULL,'Sziasztok</P>Egy-két észrevétel: \r\nKevés  a termék fotó,főleg a maratásoknál..Az e-boltnál ha a lap alján lévő pipára kattintok nem történik semmi!Csak villan egyet a kép.Valami olyan jó lenne,hogy :Megrendelését vettük.Vagy ez is az a bizonyos 1-2 funkció dolog?',NULL,NULL,1,20,'2005-07-24 09:25:39',NULL,'2005-07-24 18:21:10',NULL,NULL,1,'2006-02-13 15:35:17',4,8),(9,1,NULL,9,NULL,NULL,1,NULL,'Lucky!\r\n Kipróbáltam a rendelést és tökéletesen működik. Ha sikeres rendelést adsz le akkor a felső sorban lévő * jelre kattintva meglátod, hogy a rendelésed milyen fázisban van. plusz egyből kapsz egy visszaigazolást. Már 18.-a óta tökéletesen üzemel minden nap kipróbálom. Lehet,hogy azért nem engedte tovább a rendelésedet mert a szállítási, címnél nem töltöttél ki valamilyen rublikát. Nézd meg és próbáld újra A fotók feltöltése folyamatos, ámbár valjuk be 4000 termékről fotot szerezni az eltart egy ideig, de rajta vagyok a témán Zsolt',NULL,NULL,1,4,'2005-07-24 17:22:26',NULL,'2005-07-24 18:22:32',NULL,NULL,1,'2006-02-13 15:35:17',4,9),(10,1,NULL,10,NULL,NULL,1,NULL,'Figyelem! Mindenki írhat cikkeket és tehet fel a galériába képeket. Természetesen nyomdafestéket nem tűrő dolgokat és az élvezhetetlen minőségű képeket&nbsp;cenzúrázni fogom.',NULL,NULL,1,6,'2005-07-26 16:58:06',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4,10),(11,1,NULL,11,NULL,NULL,1,NULL,'<P>Szia Zsolt! </P>\r\n<P>Köszi a segítséget, most már müxi a rendelés.</P>',NULL,NULL,1,20,'2005-07-26 20:55:14',NULL,'2005-07-27 13:24:56',NULL,NULL,1,'2006-02-13 15:35:17',4,11),(12,1,NULL,12,NULL,NULL,1,NULL,'Lucky! Már postáztuk is a rendelésedet. ',NULL,NULL,1,4,'2005-07-27 13:26:19',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4,12),(13,5,NULL,13,NULL,NULL,1,NULL,'Kerültek fel megint új képek a galériára a 2005-ös Atlantai makettversenyről',NULL,NULL,1,6,'2005-08-02 17:20:27',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4,13),(14,6,NULL,14,NULL,NULL,1,NULL,'Akit érdekel, de főleg figurások !&nbsp;&nbsp;&nbsp; Megjelent egy könyv ami tartalmazza elég alaposan a német hadsereg egyenruháit a második világháború idejéből. láttam már sokkal részletesebb könyvet is a témáról,de az nem beszerezhető az országban és kb a 4*esébe kerül kötetenként (3-4 kötet csak az SS pl). Ebben a könyvben összefoglalva vannak benne az alakulatok az SS-től a haditengerészetig 1939-1945-ig bezárólag. ',NULL,NULL,1,6,'2005-08-05 08:32:38',NULL,'2005-08-05 08:37:42',NULL,NULL,1,'2006-02-13 15:35:17',4,14),(15,6,NULL,15,NULL,NULL,1,NULL,'Szega! Nem tudjátok hogy mikor jelenik meg a ProModell 2005/3. száma?',NULL,NULL,1,45,'2005-08-14 10:44:54',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4,15),(16,6,NULL,16,NULL,NULL,1,NULL,'',NULL,NULL,1,4,'2005-08-16 14:34:22',NULL,NULL,NULL,'2006-01-15 00:24:16',1,'2006-02-13 15:35:17',4,16),(17,6,NULL,17,NULL,NULL,1,NULL,'Hi!\r\nBorsod megyébe kb. mennyi lenne a postaköltség 2 db makettnél?\r\nHoppacska ',NULL,NULL,1,107,'2006-01-17 21:10:06',NULL,NULL,NULL,'2006-01-17 21:10:06',1,'2006-02-13 15:35:17',4,17),(18,6,NULL,18,NULL,NULL,1,NULL,'<P>Hoppácska !</P>\r\n<P>Az mindig az aktuális postai szabályzattól függ. Nézd meg a <A href=\"http://www.posta.hu-n\">www.posta.hu-n</A>. Kb 1700 ft</P>',NULL,NULL,1,4,'2006-02-10 10:51:51',NULL,NULL,NULL,'2006-02-10 10:51:51',1,'2006-02-13 15:35:17',4,18),(19,1,NULL,19,NULL,NULL,1,NULL,'<P>Szia,</P>\r\n<P>Megpóbáltam feltölteni a galériába, de ezt a hibát kaptam: Unknown column \'pictURL\' in \'field list\'.</P>\r\n<P>Mi lehet a gond?</P>\r\n<P>&nbsp;</P>',NULL,NULL,1,149,'2006-04-28 19:23:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,19);
