INSERT INTO `guestbook` VALUES (1,'Vezér',NULL,NULL,'paradox@freemail.hu',NULL,1,'Csá Zsolt fasza a lap!!! de lehetne jobbbbb!!!!!!',NULL,NULL,NULL,1,23,'2005-07-20 13:45:18',6,'2005-07-25 16:07:51',NULL,NULL,1,'2006-02-13 15:35:17',4),(2,'Vezér',NULL,NULL,'Paradox@freemail.hu',NULL,1,'Bocs ZSOLT :D',NULL,NULL,NULL,1,23,'2005-07-20 13:45:42',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4),(3,'Garry',NULL,NULL,'garry84@freemail.hu','mkhl.n1.hu',1,'Hali!\r\n\r\nTényleg \"fasza\" a lap. Tetszik a felépítése, de érdemes lenne kicsit finomítani a designon (dizájnon - mindegy...).\r\n\r\nÜdv: Garry',NULL,NULL,NULL,1,30,'2005-07-27 10:47:48',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4),(4,'Krisztián',NULL,NULL,'dorkavirag@invitel.hu',NULL,1,'Valaha létezett összes szocialista teher és személyautó modellek 1:43 méretben eladó.Tel:06-70-384-3719',NULL,NULL,NULL,1,NULL,'2005-08-03 09:47:33',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4),(5,'Tivadar',NULL,NULL,'borbola.tp@t-online.hu',NULL,1,'jó az oldal kicsit több képpel és cikkel mégjobb lenne.',NULL,NULL,NULL,1,54,'2005-10-26 19:24:55',NULL,NULL,NULL,'2005-10-26 19:24:55',1,'2006-02-13 15:35:17',4),(6,'lada1200',NULL,NULL,'ferrap@freemail.hu','zsiguli.gportal.hu',1,'sziasztok! szeretnék regisztrálni az oldalon, h rendelhessek de nem tudok mert azt irja ki h nem találja a megadott helyet.. gondoltam szólok:\r\nlada1200',NULL,NULL,NULL,1,54,'2005-11-01 11:29:58',NULL,NULL,NULL,'2005-11-01 11:29:58',1,'2006-02-13 15:35:17',4),(7,'FlamerPUG',NULL,NULL,'flamer986@freemail.hu','http://carstyling.hu/forum_shower.php?id=2249&step',1,'--',NULL,NULL,NULL,1,54,'2005-11-02 18:08:28',NULL,NULL,NULL,'2005-11-02 18:08:28',1,'2006-02-13 15:35:17',4),(8,'AlexT','#0099FF',NULL,'alext@freemail.hu',NULL,1,'Sziasztok, már lehet regisztrálni, rendelni! :-)',NULL,NULL,NULL,1,1,'2005-11-07 16:56:52',1,'2005-11-07 16:57:13',NULL,'2005-11-07 16:57:13',1,'2006-02-13 15:35:17',4),(9,'Calibra',NULL,NULL,'movinglobe@t-online.hu',NULL,1,'Szeretnék regisztrálni, de 404-es hibát jelez.\r\nSegítsetek!\r\n\r\nKösz.',NULL,NULL,NULL,1,54,'2005-12-01 13:26:24',NULL,NULL,NULL,'2005-12-01 13:26:24',1,'2006-02-13 15:35:17',4),(10,'AlexT','#0099FF',NULL,'alext@freemail.hu',NULL,1,'Calibra látom sikerült, valószínüleg épp karbantartás volt. :-)',NULL,NULL,NULL,1,1,'2005-12-02 13:52:53',1,'2005-12-02 13:53:17',NULL,'2005-12-02 13:53:17',1,'2006-02-13 15:35:17',4),(11,'Végső Szilárd',NULL,NULL,'szilard.vegso@tvnetwork.hu',NULL,1,'Sziasztok, szeretnék regisztrálni, de mindig hiba jelzést kapok. Üdv: Szilárd',NULL,NULL,NULL,1,54,'2005-12-02 20:33:18',NULL,NULL,NULL,'2005-12-02 20:33:18',1,'2006-02-13 15:35:17',4),(12,'AlexT','#0099FF',NULL,'alext@freemail.hu',NULL,1,'Szilárd, kapsz valami hibaüzit? Üdv: Alext.',NULL,NULL,NULL,1,1,'2005-12-02 22:50:19',1,'2005-12-02 22:51:07',NULL,'2005-12-02 22:51:07',1,'2006-02-13 15:35:17',4),(13,'egy modellező aki útálja a maketteket!',NULL,NULL,'@@freemail.hu',NULL,1,'ez a hely xar legalább kép lenne és modell!!!!!!!!!!!!!',NULL,NULL,NULL,1,54,'2006-01-29 10:30:03',NULL,NULL,NULL,'2006-01-29 10:30:03',1,'2006-02-13 15:35:17',4),(14,'vik',NULL,NULL,'vik94@freemail.hu',NULL,1,'Hello nagy jó ez a cím! modellek is vannak! Nagyon jó!!!',NULL,NULL,NULL,1,54,'2006-01-29 10:31:33',NULL,NULL,NULL,'2006-01-29 10:31:33',1,'2006-02-13 15:35:17',4),(15,'Pap László',NULL,NULL,'ha-sln@freemail.hu',NULL,1,'Mire is jó ez az oldal? nem találom hol lehet a termékeket megrendelni....\r\nVagy nem lehet?\r\nÉs hol egy emailcím? Hol érdeklődhetek?\r\n\r\nLaci ',NULL,NULL,NULL,1,54,'2006-02-04 13:38:19',NULL,NULL,NULL,'2006-02-04 13:38:19',1,'2006-02-13 15:35:17',4),(16,'Pap László',NULL,NULL,'ha-sln@freemil.hu',NULL,1,'Aha! Már tudom regisztrálni kell! De azt is megtudtam, hogy az itt megjelentetett terméklisták nem feltétlenül azonosak a valóban kaphatóakkal.... 2 dolgot akartam, de az nincs! Vagyis ismét megkérdem! Mire is jó ez az egész?\r\n\r\nLaci',NULL,NULL,NULL,1,54,'2006-02-04 13:41:57',NULL,NULL,NULL,'2006-02-04 13:41:57',1,'2006-02-13 15:35:17',4),(17,'Zsolt',NULL,NULL,'relica@replica.hu',NULL,1,'\"Tisztelt barátom, aki utálja a maketteket...\"\r\n\r\nHa nem vagy képes normális megnyilvánulásokra akkor inkább ne tegyél semmit,vagy  lapozgass az etikettel és a viselkedési formákkal kapcsolatos kiadványokat mert úgylátom ez hiányzott a neveltetésedből.\r\n\r\nTisztelettel Janik Zsolt \r\n\r\nReplica Modellszaküzlet',NULL,NULL,NULL,1,4,'2006-02-10 11:01:26',4,'2006-02-10 11:10:03',NULL,'2006-02-10 11:10:03',1,'2006-02-13 15:35:17',4),(18,'Zsolt',NULL,NULL,'replica@replica.hu',NULL,1,'Laci !\r\n\r\nSajnos a bolti rendszert nem sikerült még szinkronizálni az internetes rendszerrel.Ha ez megvalósúl akkor egy teljeskörü leltárt kell csinálni. Amennyiben ez megtörténik óránként fogja frissíteni a neten lévő listát a program.\r\nAmit most látsz a neten az tényleg nem a valós készlet, de ezeket a termékeknek a98%-át be tudjuk szerezni.\r\n\r\nTehát az oldal információ közlés céljából van most fent, hogy az ember tudja mivel foglalkozik a cég és mit lehet náluk beszerezni.\r\n\r\nEzért van ez itt fent\r\n\r\nTisztelettel Replica Modellbolt',NULL,NULL,NULL,1,4,'2006-02-10 11:08:47',NULL,NULL,NULL,'2006-02-10 11:08:47',1,'2006-02-13 15:35:17',4),(19,'Miki',NULL,NULL,'c.miklos@freemail.hu','nincs',1,'Szia Zsolti!  Működik most az oldalon a megrendelés? Mert az előbb rendeltem 2 terméket, de nem kaptam semmilyen visszaigazolást, és ha a jobb felső sarokban lévő \"megrendelések\"-re kattintok akkor azt írja hogy nincs találat. Most akkor sikerült a rendelés vagy nem? \r\n\r\nÜdv: Miki',NULL,NULL,NULL,1,123,'2006-02-11 15:18:51',NULL,NULL,NULL,'2006-02-11 15:18:51',1,'2006-02-13 15:35:17',4),(20,'Zsolt',NULL,NULL,'replica@replica.hu',NULL,1,'Miki! A rendelés működik, megkaptuk, válaszoltam rá. Sajnos nem túl jók a hírek,de erről mi nem tehetünk mert a cég megszünik.A problémádat továbbítottam a rendszergazdának.\r\n\r\nszia Zsolt',NULL,NULL,NULL,1,4,'2006-02-13 10:01:07',NULL,NULL,NULL,'2006-02-13 10:01:07',1,'2006-02-13 15:35:17',4),(21,'Miki',NULL,NULL,'c.miklos@chello.hu',NULL,1,'Szia Zsolti!  Megkaptam az e-mailt, köszönöm az értesítést. Megpróbálom máshol, hátha találok. De így nyílván kicsi az esélye ha leálltak az említett modellek gyártásával. \r\nTovább minden jót! \r\n\r\nTisztelettel:\r\n\r\nCzene Miklós',NULL,NULL,NULL,1,54,'2006-02-13 17:44:14',NULL,NULL,NULL,'2006-02-13 17:44:14',1,'2006-02-13 15:35:17',4),(22,'Füleki Tamás',NULL,NULL,'gomez@c2.hu',NULL,1,'Sziasztok\r\n\r\nTegnap rendeltem egy Academy Tiger Iest..Eddig láttam a megrendeléseknél, de most már nem látom, viszont e-mail-t sem kaptam...Akkor most mi is a helyzet?\r\n\r\nköszi:Tomi',NULL,NULL,NULL,1,122,'2006-03-01 13:10:18',4,'2006-03-01 13:19:13',NULL,'2006-03-01 13:19:13',1,'2006-03-01 13:19:13',4);
