INSERT INTO `message_wall` VALUES (7,4,'Nem látszó termékek',NULL,NULL,1,'Sikerült láthatóvá tenni, már csak egy terméket nem látni, de azt más okból, majd azt is kiderítem hétvégén.\r\nA termékfelvitelt módosítottam, hogyha a méretet nem adsz meg autómatikusan a *Nincs megadva* teszi bele',1,4,'2005-09-15 17:34:17',NULL,NULL,NULL,'2005-09-15 17:34:17',1,'2005-09-15 17:34:47'),(8,1,'észrevétel',NULL,NULL,1,'Sanyi! ezt az üzit kaptam nézz utánna légyszives. Köszi Zsolt\r\n\r\nSzia Zsolti! Működik most az oldalon a megrendelés? Mert az előbb rendeltem 2 terméket, de nem kaptam semmilyen visszaigazolást, és ha a jobb felső sarokban lévő \"megrendelések\"-re kattintok akkor azt írja hogy nincs találat. Most akkor sikerült a rendelés vagy nem? Üdv: Miki\r\n\r\n',1,4,'2006-02-13 10:03:07',NULL,NULL,NULL,'2006-02-13 10:03:07',1,'2006-02-13 12:24:17'),(9,1,'észrevétel',NULL,NULL,1,'Sanyi !\r\n\r\nKüldtem neked az ügyfélkapura.\r\n\r\nZsolt',1,4,'2006-03-01 10:06:10',NULL,NULL,NULL,'2006-03-01 10:06:10',1,'2006-03-01 14:07:54'),(10,1,'valami gond',NULL,NULL,1,'	Sziasztok Tegnap rendeltem egy Academy Tiger Iest..Eddig láttam a megrendeléseknél, de most már nem látom, viszont e-mail-t sem kaptam...Akkor most mi is a helyzet? köszi:Tomi',1,4,'2006-03-01 13:19:40',NULL,NULL,NULL,'2006-03-01 13:19:40',1,'2006-03-01 14:08:04'),(11,4,'Nissan Skyline 1/18',NULL,NULL,1,'Helló Zsolt!\r\nLáttam a 2 e - mailt a gépemen, amit küldtetek nekem, de nincs bennük semmi. Érdekelne, hogy van - e nálatok 1/18 asban Nissan Skyline, amielyik fent van a termékek közt\r\nÜdvözlettel: Garbacz Laci Sopronból',1,135,'2006-03-11 11:08:27',NULL,NULL,NULL,NULL,1,'2006-03-14 10:06:02'),(12,135,'skyline',NULL,NULL,1,'Szia !\r\n\r\nSajnos azokat az e-maileket a levelezőrendszerünk önmaga kreálja, de még nem jöttünk rá, hogy miért. Küldtem viszont egy e-mailt ahol válaszoltam a rendelésedre.\r\n\r\nszia Zsolt',1,4,'2006-03-14 10:08:38',NULL,NULL,NULL,NULL,1,'2006-03-22 22:37:38'),(13,1,'e-mail',NULL,NULL,1,'A levelező rendszer még mindig küldözgeti az üres leveleket.\r\n\r\nZsolt',1,4,'2006-03-14 10:09:28',NULL,NULL,NULL,NULL,1,'2006-03-17 10:21:42'),(14,4,'ezzel kellena valamit kezdeni.',NULL,NULL,1,'Feladó: Cser Imre <imrecser@invitel.hu>\r\nTárgy: hy\r\nÉrkezett: 2006.03.16 20:51:43\r\nHello!\r\nÉrdeklődni szeretnék hogy megrendelésre raknak össze maketteket?A\r\nszállítás hogyan oldaható meg?\r\nCSer marci\r\n\r\n',1,1,'2006-03-17 10:23:02',NULL,NULL,NULL,NULL,1,'2006-03-17 10:46:38'),(15,1,'akármi',NULL,NULL,1,'Ok köszi. Válaszoltam rá. A skype eltünt. Pedig nem uninstaláltam. Egyszercsak eltünt. Mi a bolti témával a helyzet? azt írtad, hogy csütörtökön felrakod, hogy pénteken tudjak mazsolázni. a saját cuccomat is csütörtökre igérted.\r\n\r\nszia Zsolt',1,4,'2006-03-17 10:57:53',NULL,NULL,NULL,NULL,1,'2006-03-17 12:27:53'),(16,4,'akármi',NULL,NULL,1,'ma is hagy bekapcsolva a gépet, ha nem tudom felpakolni akkor holnap megyek és helyben felrakom.',1,1,'2006-03-17 12:29:21',NULL,NULL,NULL,NULL,1,'2006-03-18 09:13:09'),(17,4,'Helyzet',NULL,NULL,1,'Szia Zsolt!\r\nMa csak este tudok jelentkezni, egy hibát kell még kijavítanom a helyiben, valamiért némelyik felvitelnél dupla sort visz be ezt ma javítom, már csak ezen \"görcsölök\".\r\nAz \"levél válasz\"-t is kikapcsoltam, úgy tünik a dataglobe-nál is be volt kapőcsolva.\r\nMa is hagyd bekapcsolva, ha tudok 18 óra körül jelentkezem a skype-on!\r\nÜdv,\r\nSándor\r\n',1,1,'2006-03-20 11:06:14',NULL,NULL,NULL,NULL,1,'2006-03-20 15:59:51'),(18,4,'ismét',NULL,NULL,1,'Feladó: Cser Imre <imrecser@invitel.hu>\r\nTárgy: makett\r\nÉrkezett: 2006.03.17 18:36:30\r\n\r\nHy!\r\nCsak az a baj,hogy én veszprémi vagyok.\r\ntehát gondolom akkor nincs esély',1,1,'2006-03-21 09:37:09',NULL,NULL,NULL,NULL,1,'2006-03-21 14:09:52'),(19,4,'Helyzet',NULL,NULL,1,'Szia!\r\nBocsi most csak így tudok jelentkezni, holnaptól otthon leszek, amíg meg nem csinálom neked, illetve a replicát.\r\nMa is bekapcsolva kellene hagyni.\r\nReggel kezdünk.\r\nÜdv,\r\nSaándor',1,1,'2006-04-05 13:42:27',NULL,NULL,NULL,NULL,1,'2006-04-06 09:45:29'),(20,1,'Saját regisztrációs program',NULL,NULL,1,'Szia Sándor !\r\n\r\nHosszú viaskodás után úgy döntöttem, hogyha nem lesz kész a cuccom keddig ( 04.18)akkor lemondom a projektet. Következő hónapban  legkésőbb el kéne kezdenem a regisztrációkat rajta vezetni. Ha készen van kedden akkor tudjuk tesztelni és feltölteni 2 hét alatt. Ha viszont nem lesz kész ebben a hónapban akkor már úgyis mindegy hiszen a kimutatásokat a szövetség felé le kell adnom akkor megcsinálom kézzel( excel) és kész. December óta várok rá úgy,hogy minden adat már le lett adva tartalom, designe minden.Sajnálom és nem akarlak megbántani,de a legutolsó amit ezzel kapcsolatban mondtál az az,hogy 6.-áig kész \" Ide a rozsdás bökőt\" tudom, hogy megbeszéltük egy kicsit túlvállaltad magad, munkahely stb. Erről én nem tehetek és 6.-a óta eltelt 9 nap. Remélem a jóbaráti kapcsolat azért megmarad függetlenül ettől a dologtól. Szia Zsolt',1,4,'2006-04-15 13:55:36',NULL,NULL,NULL,NULL,1,'2006-04-20 17:57:39'),(21,19,'cv',NULL,NULL,1,'Nem tudja valaki hogy mennyi a postaköltség?',1,191,'2006-07-31 15:13:04',NULL,NULL,NULL,NULL,0,NULL);
/*!40000 ALTER TABLE `message_wall` ENABLE KEYS */;
UNLOCK TABLES;

