INSERT INTO `news_item` VALUES (1,1,NULL,'új árú',NULL,NULL,1,'<P>Figyelem !&nbsp;&nbsp;&nbsp;&nbsp; Új áru érkezésének várható ideje :Június közepe&nbsp; Replica modellbolt 2005.05.30</P>',1,4,'2005-05-30 10:09:56',NULL,'2005-06-30 12:58:36',NULL,NULL,1,'2006-02-13 15:35:17',4),(3,2,NULL,'Új árú',NULL,NULL,1,'Figyelem ! A mai napon megérkezett az új Hasegawa szállítmány.&nbsp; 2005.06.30',1,4,'2005-06-30 12:56:51',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4),(4,6,NULL,'Humbrol Maisto',NULL,NULL,1,'Figyelem! Érkeztek Humbrol festékek nagy számban. Jött például Decal fix és Clear fix is plusz&nbsp;Maisto autók, Airfix 1/72 makettek.',1,6,'2005-07-26 17:02:46',1,'2005-09-05 16:02:33',NULL,NULL,1,'2006-02-13 15:35:17',4),(7,6,NULL,'Kiadványok',NULL,NULL,1,'<P><STRONG>Érkeztek&nbsp;H&amp;C kiadványok</STRONG>.&nbsp;</P>\r\n<P>Újdonságok :&nbsp;</P>\r\n<P>&nbsp;2&nbsp;világháborús Német egyenruhás könyv&nbsp; 136 oldalas szines !!&nbsp;</P>\r\n<P>Steel master (67,68,69),steel master horse (24,25), wing master ( 45,46,47)&nbsp;új számai</P>',1,6,'2005-08-04 17:30:06',6,'2005-08-05 12:50:43',NULL,NULL,1,'2006-02-13 15:35:17',4),(8,6,NULL,'Tamiya',NULL,NULL,1,'<P>Érkezett Tamiya, új és régebbi készletek is. Pl willys jeep aminek a gyártásával 2 éve leálltak,stb.&nbsp;Dragon :vietkong, seals, figurák drilling és egyéb harcjárművek.</P>',1,6,'2005-08-31 09:29:00',4,'2005-09-07 10:12:34',NULL,'2005-09-07 08:45:20',1,'2006-02-13 15:35:17',4),(9,3,NULL,'Eduard    Hetzer     1/35',NULL,NULL,1,'Figyelem! Az Eduard cég úgy látszik terjeszkedni szeretne az 1/35-ös piacon ezért kidobta első makettjét a Hetzert. Itt küldök egy-két fotót a járműről. ( www.eduard.cz) ',1,4,'2005-11-07 09:47:47',4,'2005-11-07 09:50:23',NULL,'2005-11-07 09:48:02',1,'2006-02-13 15:35:17',4),(10,6,NULL,'AFV, Nemrod',NULL,NULL,1,'<P>Figyelem !</P>\r\n<P>Érkezett AFV, Nemrod makettek jó áron. PL: </P>\r\n<P>AFV Tiger I:6223.- , 8,8 Flak 6286.- stb</P>',1,4,'2005-11-16 10:18:03',4,'2005-11-16 10:33:23',NULL,