rkezett a cseh árú. Sajnos sokminden men érkezett a rendelt termékek közül. Főleg kiegészítők jöttek',1,4,'2005-12-17 16:31:18',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4),(58,6,NULL,'Dragon, Tamiya',NULL,NULL,1,'Figyelem Dragon harcjárművek érkeztek nagy számban! (15-20 féle 1/35-ös, kd 8-10 féle 72-es harcjármű)\r\n',1,4,'2005-12-17 16:34:20',NULL,NULL,NULL,NULL,1,'2006-02-13 15:35:17',4),(59,6,'news_item_59.jpg','ANDREA termékcsalád forgalmazása',NULL,NULL,1,'Figurások figyelem !! Lehetőségünk nyílt arra, hogy andrea termékeket forgalmazzunk. Egyenlőre felmérést végzünk, hogy milyen termékeket hozzunk be. Ebben kérem mindenki segítségét( ötletekkel). Akit érdekel az hívjon minket telefonon, itt fel tudjuk venni a rendelését. Az első szállítmány kb 1 hónap múlva esedékes. Ha valakit érdekel az andrea termékcsalád listája az kattintson a főoldalon lévő andrea ikonra ami előreláthatólag szerdán lesz feltöltve, itt meg tudja nézni a bolti árakat is. Ime egy kis ízelítő minkden kategóriából kiragadtunk egy tételt:&nbsp;&nbsp;&nbsp; Mindenki aki előrendelést ad le és regisztrálva van nálunk az 10% kedvezményt kap az első szállításból.Köszönettel Replica modellbolt ',1,4,'2006-02-18 09:54:27',4,'2006-03-02 12:31:48',NULL,'2006-03-02 12:31:48',1,'2006-03-02 12:31:48',4),(60,6,NULL,'Andrea árú érkezett',NULL,NULL,1,'&nbsp; Izelítőnek felraktam egy-két képet az érkezett árúból (kb 40-50 figura, kiadványok, matricák, kiegészítők jöttek9',1,4,'2006-04-24 10:11:43',4,'2006-04-24 10:20:21',NULL,NULL,1,'2006-04-24 10:20:21',4);
