DROP TABLE IF EXISTS `product_item`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `product_item` (
  `id` int NOT NULL AUTO_INCREMENT,
  `productid` varchar(13) NOT NULL DEFAULT '',
  `barcode` varchar(13) DEFAULT NULL,
  `maker_id` int DEFAULT '0',
  `topic_id` int DEFAULT '0',
  `name` varchar(80) NOT NULL DEFAULT '',
  `size_id` int DEFAULT '1',
  `priceHUF` double NOT NULL DEFAULT '0',
  `pictURL` varchar(100) DEFAULT NULL,
  `description` longtext,
  `bgcolor` varchar(7) DEFAULT NULL,
  `fgcolor` varchar(7) DEFAULT NULL,
  `novelty` int DEFAULT '1',
  `sale` int DEFAULT NULL,
  `sold` int DEFAULT NULL,
  `active` int DEFAULT '1',
  `lang_id` int NOT NULL DEFAULT '0',
  `insert_user_id` int NOT NULL DEFAULT '0',
  `insert_datetime` datetime DEFAULT NULL,
  `modify_user_id` int DEFAULT NULL,
  `modify_datetime` datetime DEFAULT NULL,
  `visitcounter` int DEFAULT NULL,
  `lastvisit` datetime DEFAULT NULL,
  `is_read` int DEFAULT NULL,
  `is_read_datetime` datetime DEFAULT NULL,
  `is_read_user_id` int DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4895 DEFAULT CHARSET=utf8mb3;
/*!40101 SET character_set_client = @saved_cs_client */;

