INSERT INTO `support_item` VALUES (1,1,'',1,'észrevétel',NULL,NULL,NULL,'Sziasztok..<BR><BR>A tegnapi nap folyamán rendeltem tőletek egy Academy Tigris I-et..<BR>Bár azt írjátok az oldalon, hogy akkor jeleztek e-mailban, ha nincs készleten, mégis jó lenne,<BR>ha valamilyen formában kapna a megrendelő (jelen esetben én) egy visszaigazolást, hogy rögzítettük, stb-stb....<BR><BR>Érdeklődnék, hogy van-e készleten, és hogy most csütörtökön tudjátok e küldeni..<BR><BR>Különben én egy webstúdióban dolgozom, ha gondoljátok meg lehetne<BR>csinálni a webáruházat, ill az egész adatbázis rendszert..Ezen kívül a<BR>grafikára is elkelne egy kis ráncfellvarrás..:)<BR><BR>Persze ez építő jellegű kritika akart lenni..<BR><BR>Tisztelettel:<BR><BR>Füleki Tamás<BR><BR><A href=\"mailto:gom3z@solidweb.hu\">gom3z@solidweb.hu</A><BR><A href=\"http://www.solidweb.hu\">www.solidweb.hu</A><BR>Szombathely<BR>',1,4,'2006-03-01 10:04:31',NULL,NULL,NULL,'2006-03-01 10:04:31',1,'2006-03-01 10:04:31',4);
/*!40000 ALTER TABLE `support_item` ENABLE KEYS */;
